import React from 'react';
import './Session.css';
import Form from './Form';
import DataTable from 'react-data-table-component';

const data = [{ id: 1, title: 'Conan the Barbarian', year: '1982' }];
const columns = [
  {
    name: 'Title',
    selector: 'title',
    sortable: true,
  },
  {
    name: 'Year',
    selector: 'year',
    sortable: true,
    right: true,
  },
];

function Session() {
    return (
        <div className='products'>
      <DataTable
      title="Arnold Movies"
      columns={columns}
      data={data}
      />
    </div>
    )
}
export default Session;
